-- This is to ensure BikeAccess is restricted on expressways. OSM data fields on this exist but are not accurate
-- Step 1: Check if the column 'rsbikeaccess' exists, drop it if it does
DO $$
BEGIN
    IF EXISTS (
        SELECT 1 
        FROM information_schema.columns 
        WHERE table_name = 'osm_all_roads' 
        AND column_name = 'rsbikeaccess'
    ) THEN
        -- Drop the column if it exists
        ALTER TABLE osm_all_roads DROP COLUMN IF EXISTS rsbikeaccess;
    END IF;
END $$;

-- Step 2: Add the column 'rsbikeaccess' to the table with a default value of 'yes'
ALTER TABLE osm_all_roads ADD COLUMN IF NOT EXISTS rsbikeaccess VARCHAR(3) DEFAULT 'yes';

